import styled from 'styled-components';

export const StyledSelect = styled.select`
    padding: 10px 15px 10px 15px;
    color: #f1f1f1;
    appearance: none;
    -webkit-appearance: none; 
    -moz-appearance: none; 
    font-size: 1.2em;
    border: none;
    background: #1a1a1a;
    font-family: "Roboto Mono", monospace;

    option {
        padding: 10px;
    }
`;
